import React from 'react';
import './App.css';
import Home from '../src/components/Home';
import Head from '../src/components/Head';

function App() {
	function changeHeadColor(e) {
    e.target.style.color = '#72ab72';
	}

  return (
    <div className="App">
				<Head/>
			<div onMouseLeave={changeHeadColor} className="Hover">
      	<Home/>
      	<Home/>
      	<Home/>
      	<Home/>
			</div>
    </div>
  );
}

export default App;
